(1, 'School of Arts and Sciences', '<p style="text-align: justify;">The School&nbsp;of Arts and Sciences is the home of several nationally accredited undergraduate and graduate programs.&nbsp; Scientific inquiry and historical awareness, social relations, and general welfare are themes flowing through the curriculum, which are imagined, formulated, and implemented by dedicated and accomplished faculty members who constantly seek regular updating, engage in innovative research and artistically creative endeavors.</p>\n<p style="text-align: justify;">With two divisions (Arts division and Sciences Division) covering ten academic departments and several affiliated centers and institutes, the College of Arts and Sciences provides an environment where students may both explore a wide range of interests and find their areas of specialization.</p>\n<p style="text-align: justify;">The College&rsquo;s curricular offerings teach students to discover knowledge independently, and to think critically, creatively, and analytically.</p>\n<p style="text-align: justify;">The College prepares students for professional careers and provides them with the foundation for lifelong learning.&nbsp; It also has the primary responsibility for the two-year general education curriculum required of all students of the university.</p>', 'none', 38),
(2, 'School of Business and Economics', '<p style="text-align: justify;">The School of Business and Economics (SBE) is previously named as the College of Commerce of the University of San Carlos. It has come a long way after it was founded in 1937. Fr. Bernard Bonk, SVD, is the founder and first Dean of the college of the then San Carlos College, now the University of San Carlos. It is currently composed of the following departments: Accountancy, Business Administration, Hospitality Management, Economics, and Graduate Programs.</p>', 'none', 58),
